export default function ListPage() {
  return (
    <div className='flex justify-center'>
      <iframe 
        src="https://www.youtube.com/embed/R_IeYv6BGXk" 
        className='w-[60vw] aspect-video'
        title="YouTube video"
      ></iframe>
    </div>
  );
}
